import React from "react";
import { FC, useState } from "react";
import Form from "react-bootstrap/Form";
import { PartnerType } from "../../api/domain/partner-type.enum";

export interface PartnerTypeFormProps {
  partnerType: PartnerType;
}

export const PartnerTypeForm: FC<PartnerTypeFormProps> = ({ partnerType }) => {

const [partnerTypeState, setPartnerTypeState] = useState<PartnerType>(partnerType);




  return (
    <>
      <Form aria-readonly>
        <fieldset>
          <Form.Group controlId="exampleForm.ControlSelect1">
            <h2>Тип партнерства</h2>
            <Form.Control as="select" >
              <option>
                {partnerType === PartnerType.legalEntity
                  ? "Юридическое лицо"
                  : "Физическое лицо"}
              </option>
              <option>
                {partnerType === PartnerType.naturalPerson 
                ? "Юридическое лицо"
                : "Физическое лицо"}
              </option>
            </Form.Control>
          </Form.Group>
        </fieldset>
      </Form>
    </>
  );
};
